import './styles.css'

export const BotonCheckBox = () => {
  return (
    <>
      <div class="form-check">
        <input
          className="BotonCheckBox"
          class="form-check-input"
          type="checkbox"
          value=""
          id="flexCheckChecked"
        />
      </div>
    </>
  );
};
